import React from "react";
import { useNavigate } from "react-router-dom";
import "./ProblemsPage.css";

function ProblemsPage({ problems }) {
  const navigate = useNavigate();

  if (!problems || problems.length === 0) {
    return (
      <div className="problems-grid-outer">
        <div className="problems-empty">No problems available.</div>
      </div>
    );
  }

  return (
    <div className="problems-grid-outer">
      <div className="problems-grid-card">
        <h2 className="problems-grid-title">Problems List</h2>
        <div className="problems-grid-list">
          {problems.map(problem => (
            <div className="problem-card" key={problem.id}>
              <div>
                <div className="problem-card-title">{problem.title}</div>
                <div
                  className={`problem-card-diff ${
                    problem.difficulty === "Easy"
                      ? "diff-easy"
                      : problem.difficulty === "Medium"
                      ? "diff-medium"
                      : "diff-hard"
                  }`}
                >
                  {problem.difficulty}
                </div>
              </div>
              <button
                className="problem-card-solve"
                onClick={() => navigate(`/solve/${problem.id}`)}
              >
                Solve
              </button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default ProblemsPage;
